        <h3 className={style.h3}>üìú ABOUT üìó</h3>
      </Link>
      <Link to="/">
        <h3 className={style.h3}> Logout </h3>
      </Link>
      <Link to="/favorites">
        <button className={style.buttonFav}>‚ù§Ô∏è Favoritos ‚ù§Ô∏è</button>
      </Link>
      <SearchBar onSearch={onSearch} />
    </nav>
  );
}
